import styled from "styled-components";

const Container = styled.div`
    height 10vh;
    width 20vw;
    display: flex;
    align-items: center;
    justify-content: center;
`;

const Oval = styled.div`
    height:200px;
    width: 210px;
    border-radius: 50%;
    background-color: #ede3df;
    position: relative;
`;

const Text = styled.div`
    font-family: 'Oooh Baby', cursive;
    font-size: 100px;
    position: absolute;
    padding-left: 100px; 
`;
const SubText = styled.div`
    font-size: 20px;
    position: absolute;
    padding-left: 200px;
    padding-top: 120px;
`;
                                                
const Logo = () => {
    return(
    <Container>
        <Oval/>            
        <Text>CULT</Text>
        <SubText>M A G A Z I N E</SubText>
    </Container>
    );   
}

export default Logo;
